import React, { useEffect, useState } from "react";
import Financial from "../controllers/financial/Financial";

const Networth = () => {
  return (
    <div className="networth-page-container">
      <div className="header-card">
        <p className="title">Net Worth and Financial Overview</p>
      </div>
      <hr />

      <div className="networth-section">
        <h2>Net Worth History</h2>
        <p>Net worth chart or visualization can go here.</p>
      </div>

      <div className="financial-section">
        <Financial />
      </div>
    </div>
  );
};

export default Networth;
